import logo from './logo.svg';
import './App.css';
import { AuthProvider, useAuth } from './web/AuthContext';
import Logout from './web/cmpts/Logout';
import Login from './web/cmpts/Login';
import Post from './web/cmpts/CreatePost';
import Form from './web/cmpts/FillPreMedicalForm';
import Doct from './web/cmpts/DoctorPage';

function App() {
  const { user } = useAuth();

  return (
    <div className="App">
      <AuthProvider>
        {user ? (
          // Render components after login
          <>
            <Post />
            <Form />
            <Doct />
            <Logout />
          </>
        ) : (
          // Render the login component if the user is not authenticated
          <Login />
        )}
      </AuthProvider>
    </div>
  );
}

export default App;
